import{_ as t,a as e}from"./chunks/rtk_here_plug_gps_to_6pin_connector.DQV61SSg.js";import{_ as r,c as o,o as i,ab as l}from"./chunks/framework.CUflZczI.js";const f=JSON.parse('{"title":"HEX/ProfiCNC Here2 GPS (Discontinued)","description":"","frontmatter":{},"headers":[],"relativePath":"ko/gps_compass/gps_hex_here2.md","filePath":"ko/gps_compass/gps_hex_here2.md"}'),s={name:"ko/gps_compass/gps_hex_here2.md"},a=l('<h1 id="hex-proficnc-here2-gps-discontinued" tabindex="-1">HEX/ProfiCNC Here2 GPS (Discontinued) <a class="header-anchor" href="#hex-proficnc-here2-gps-discontinued" aria-label="Permalink to &quot;HEX/ProfiCNC Here2 GPS (Discontinued)&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>This has been superseded by the <a href="https://www.cubepilot.com/#/here/here3" target="_blank" rel="noreferrer">Cube Here 3</a></p></div><p><a href="http://www.proficnc.com/all-products/152-gps-module.html" target="_blank" rel="noreferrer">Here2 GPS 수신기</a>는 HEX의 Here GPS 모듈에 대한 업데이트입니다.</p><p>주요 특징은 다음과 같습니다.</p><ul><li>Concurrent reception of up to 3 GNSS (GPS, Galileo, GLOSNASS, BeiDou)</li><li>업계 최고의 - 167dBm 탐색 감도</li><li>보안 및 무결성 보호</li><li>모든 위성 증강 시스템 지원</li><li>고급 재밍 및 스푸핑 감지</li></ul><img src="'+t+'"><h2 id="where-to-buy" tabindex="-1">Where to Buy <a class="header-anchor" href="#where-to-buy" aria-label="Permalink to &quot;Where to Buy&quot;">​</a></h2><ul><li><a href="http://www.proficnc.com/all-products/152-gps-module.html" target="_blank" rel="noreferrer">ProfiCNC</a> (오스트레일리아)</li><li><a href="http://www.proficnc.com/stores" target="_blank" rel="noreferrer">기타 리셀러</a></li></ul><h2 id="설정" tabindex="-1">설정 <a class="header-anchor" href="#설정" aria-label="Permalink to &quot;설정&quot;">​</a></h2><p>PX4의 설정과 사용법은 대부분 플러그앤플레이입니다.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><ul><li>If the GPS is <em>not detected</em> then <a href="https://docs.cubepilot.org/user-guides/here-2/updating-here-2-firmware" target="_blank" rel="noreferrer">update the Here2 firmware</a>.</li><li>If the GPS is detected but does not work, attempt the process outlined in <a href="https://docs.cubepilot.org/user-guides/here-2/here-2-can-mode-instruction" target="_blank" rel="noreferrer">allocating node uavcan ID</a>.</li></ul></div><h2 id="배선" tabindex="-1">배선 <a class="header-anchor" href="#배선" aria-label="Permalink to &quot;배선&quot;">​</a></h2><p>Here2 GPS는 <a href="http://www.hex.aero/wp-content/uploads/2016/07/DRS_Pixhawk-2-17th-march-2016.pdf" target="_blank" rel="noreferrer">Pixhawk 2</a> GPS UART 포트에 직접 삽입할 수있는 8 핀 커넥터와 함께 제공됩니다.</p><p>Pixhawk 3 Pro와 Pixracer에는 6 핀 GPS 포트 커넥터가 있습니다. 이러한 컨트롤러에서는 GPS 케이블 (아래 그림 참조)을 수정하여 핀 6과 7을 제거할 수 있습니다.</p><img src="'+e+'" width="500px"><p>핀 6과 7은 안전 버튼용이며 필요한 경우 부착 가능합니다.</p><h3 id="핀배열" tabindex="-1">핀배열 <a class="header-anchor" href="#핀배열" aria-label="Permalink to &quot;핀배열&quot;">​</a></h3><p>Here2 GPS 핀배열은 아래에서 제공합니다. 이것은 다른 자동조종보드용 커넥터를 수정할 수 있습니다.</p><table><thead><tr><th>핀</th><th>Here2 GPS</th><th>핀</th><th>Pixhawk 3 Pro GPS</th></tr></thead><tbody><tr><td>1</td><td>VCC_5V</td><td>1</td><td>VCC</td></tr><tr><td>2</td><td>GPS_RX</td><td>2</td><td>GPS_TX</td></tr><tr><td>3</td><td>GPS_TX</td><td>3</td><td>GPS_RX</td></tr><tr><td>4</td><td>SCL</td><td>4</td><td>SCL</td></tr><tr><td>5</td><td>SDA</td><td>5</td><td>SDA</td></tr><tr><td>6</td><td>BUTTON</td><td>-</td><td>-</td></tr><tr><td>7</td><td>BUTTON_LED</td><td>-</td><td>-</td></tr><tr><td>8</td><td>GND</td><td>6</td><td>GND</td></tr></tbody></table><h2 id="사양" tabindex="-1">사양 <a class="header-anchor" href="#사양" aria-label="Permalink to &quot;사양&quot;">​</a></h2><ul><li><strong>프로세서:</strong> STM32F302</li><li><strong>센서</strong><ul><li><strong>나침반, 자이로, 가속도계:</strong> ICM20948</li><li><strong>기압계:</strong> MS5611</li></ul></li><li><strong>수신기 유형:</strong> 72-채널 u-blox M8N 엔진, GPS/QZSS L2 C/A, GLONASS L10F, BeiDou B11, Galileo E1B/C, SBAS L1 C/A: WAAS, EGNOS, MSAS, GAGAN</li><li><strong>내비게이션 업데이트 속도:</strong> 최대 : 10Hz</li><li><strong>위치 정확도:</strong> 3D 수정</li><li><strong>최초 수정 시간 :</strong><ul><li><strong>콜드 스타트:</strong> 26 초</li><li><strong>지원 시작:</strong> 2 초</li><li><strong>재 획득:</strong> 1 초</li></ul></li><li><strong>감도:</strong><ul><li><strong>추적 및 탐색:</strong> -167dBm</li><li><strong>핫 스타트:</strong> -148dBm</li><li><strong>콜드 스타트:</strong> - 157 dBm</li></ul></li><li><strong>보조 GNSS</strong><ul><li>AssistNow GNSS 온라인</li><li>AssistNow GNSS 오프라인 (최대 35 일)</li><li>AssistNow Autonomous (최대 6 일)</li><li>OMA 공급 및 GPP 준수</li></ul></li><li><strong>발진기:</strong> TCXO (NEO-8MN/Q)</li><li><strong>RTC 크리스탈:</strong> 빌드 인</li><li><strong>ROM:</strong> Flash (NEO-8MN)</li><li><strong>사용 가능한 안테나:</strong> Active Antenna 및 패시브 안테나</li><li><strong>신호 무결성:</strong> SHA 256을 사용한 서명 기능</li><li><strong>프로토콜 및 인터페이스:</strong><ul><li><strong>UART/I2C/CAN:</strong> JST_GH 메인 인터페이스, 내부 스위치.</li><li><strong>STM32 기본 프로그래밍 인터페이스:</strong> JST_SUR</li></ul></li></ul>',21),n=[a];function d(h,c,g,p,u,_){return i(),o("div",null,n)}const P=r(s,[["render",d]]);export{f as __pageData,P as default};
